import axios from "axios";
import React, { useEffect, useState } from "react";
import { Link, redirect, useNavigate } from "react-router-dom";
import axiosInstance from "../baseurl";
import ApproveDoc from "./ApproveDoc";

function Adminpage() {
  const [cusdata, setcdata] = useState([
    { name: "cus1", email: "testmail1", empid: 1, gender: "male" },
    { name: "cus2", email: "testmail2", empid: 2, gender: "female" },
  ]);
  const [docdata, setddata] = useState([
    { name: "doc1", email: "testmail1", empid: 1, gender: "male" },
    { name: "doc2", email: "testmail2", empid: 2, gender: "female" },
  ]);

  const [gymdata, setgdata] = useState([
    { name: "gym1", email: "testmail1", empid: 1, gender: "male" },
    { name: "gym2", email: "testmail2", empid: 2, gender: "female" },
  ]);

  useEffect(() => {
    axiosInstance
      .post(`/viewCustomers`)
      .then((res) => {
        console.log(res, "cus");
        if (res.data.msg == "No Data obtained ") {
          setcdata([]);
        } else {
          setcdata(res.data.data);
        }
      })
      .catch((err) => {
        console.log(err);
      });

    axiosInstance
      .post(`/viewAllDoctors`)
      .then((res) => {
        console.log(res, "doc");
        if (res.data.msg == "No Data obtained ") {
          setddata([]);
        } else {
          setddata(res.data.data);
        }
      })
      .catch((err) => {
        console.log(err);
      });

    axiosInstance
      .post(`/viewGyms`)
      .then((res) => {
        console.log(res, "gym");
        if (res.data.msg == "No Data obtained ") {
          setgdata([]);
        } else {
          setgdata(res.data.data);
        }
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  if (localStorage.getItem("adminlog") == 1) {
    return (
      <div className="productdiv1" style={{ minHeight: "400px" }}>
        <div class="accordion" id="accordionExample">
          <div class="accordion-item">
            <h2 class="accordion-header">
              <button
                class="accordion-button collapsed"
                type="button"
                data-bs-toggle="collapse"
                data-bs-target="#collapseFour"
                aria-expanded="false"
                aria-controls="collapseFour"
              >
                Approve Doctors
              </button>
            </h2>
            <div
              id="collapseFour"
              class="accordion-collapse collapse"
              data-bs-parent="#accordionExample"
            >
              <div class="accordion-body">
                <ApproveDoc />
              </div>
            </div>
          </div>
          <div class="accordion-item">
            <h2 class="accordion-header">
              <button
                class="accordion-button collapsed"
                type="button"
                data-bs-toggle="collapse"
                data-bs-target="#collapseOne"
                aria-expanded="false"
                aria-controls="collapseOne"
              >
                View all Customer
              </button>
            </h2>
            <div
              id="collapseOne"
              class="accordion-collapse collapse show"
              data-bs-parent="#accordionExample"
            >
              <div class="accordion-body">
                <div class="container text-center">
                  <div class="row">
                    {/* cusdata details mapped */}
                    {cusdata.length ? (
                      cusdata.map((a) => {
                        return (
                          <div className="col">
                            <div class="card card-body">
                              <div className="main">
                                <div class="card" style={{ width: "200px" }}>
                                  <div class="card-body">
                                    <h5 class="card-title">{a.name}</h5>
                                    <p class="card-text">Email : {a.email}</p>
                                    <p class="card-text">Gender : {a.gender}</p>
                                  </div>
                                </div>
                              </div>
                            </div>
                          </div>
                        );
                      })
                    ) : (
                      <div class="card card-body">
                        <div className="main">
                          <div class="card" style={{ width: "18rem;" }}>
                            <div class="card-body">
                              <h5 class="card-title">No data</h5>
                            </div>
                          </div>
                        </div>
                      </div>
                    )}
                  </div>
                </div>
                {/* cusdata details mapped */}
              </div>
            </div>
          </div>
          <div class="accordion-item">
            <h2 class="accordion-header">
              <button
                class="accordion-button collapsed"
                type="button"
                data-bs-toggle="collapse"
                data-bs-target="#collapseTwo"
                aria-expanded="false"
                aria-controls="collapseTwo"
              >
                View all Doctors
              </button>
            </h2>
            <div
              id="collapseTwo"
              class="accordion-collapse collapse"
              data-bs-parent="#accordionExample"
            >
              <div class="accordion-body">
                {/* docdata details mapped */}
                {docdata.length ? (
                  docdata.map((a) => {
                    return (
                      <div class="card card-body">
                        <div className="main">
                          <div class="card" style={{ width: "18rem;" }}>
                            <div class="card-body">
                              <h5 class="card-title">Doctor name : {a.name}</h5>
                              <h6 class="card-title">
                                Specialization : {a.specialization}
                              </h6>
                              <p class="card-text">Email : {a.email}</p>
                              <p class="card-text">Contact : {a.contact}</p>
                            </div>
                          </div>
                        </div>
                      </div>
                    );
                  })
                ) : (
                  <div class="card card-body">
                    <div className="main">
                      <div class="card" style={{ width: "18rem;" }}>
                        <div class="card-body">
                          <h5 class="card-title">No data</h5>
                        </div>
                      </div>
                    </div>
                  </div>
                )}
                {/* docdata details mapped */}{" "}
              </div>
            </div>
          </div>
          <div class="accordion-item">
            <h2 class="accordion-header">
              <button
                class="accordion-button collapsed"
                type="button"
                data-bs-toggle="collapse"
                data-bs-target="#collapseThree"
                aria-expanded="false"
                aria-controls="collapseThree"
              >
                View Gyms
              </button>
            </h2>
            <div
              id="collapseThree"
              class="accordion-collapse collapse"
              data-bs-parent="#accordionExample"
            >
              <div class="accordion-body">
                {/* gym details mapped */}
                {gymdata.length ? (
                  gymdata.map((a) => {
                    return (
                      <div class="card card-body">
                        <div className="main">
                          <div class="card" style={{ width: "18rem;" }}>
                            <div class="card-body">
                              <h5 class="card-title">Gym name : {a.name}</h5>
                              <h6 class="card-title">
                                Specialization : {a.specialization}
                              </h6>
                              <p class="card-text">Email : {a.email}</p>
                              <p class="card-text">Contact : {a.contact}</p>
                            </div>
                          </div>
                        </div>
                      </div>
                    );
                  })
                ) : (
                  <div class="card card-body">
                    <div className="main">
                      <div class="card" style={{ width: "18rem;" }}>
                        <div class="card-body">
                          <h5 class="card-title">No data</h5>
                        </div>
                      </div>
                    </div>
                  </div>
                )}
                {/* gym details mapped */}{" "}
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  } else {
    return (
      <div style={{ minHeight: "400px" }}>
        <h1 style={{ textAlign: "center", position: "relative", top: "150px" }}>
          Please{" "}
          <Link style={{ fontSize: "50px" }} to="/Admin">
            log in{" "}
          </Link>
          to see admin panel{" "}
        </h1>
      </div>
    );
  }
}

export default Adminpage;
